import React from "react";
import "../Login/Login.css";
import { auth, provider } from "../Firebase";
import { useDispatch } from "react-redux";

const Login = () => {
  const dispatch = useDispatch();
  const loginHandler = () => {
    auth.signInwithPopup(provider).then(({ user }) => {
      console.log(user);
    });
  };
  return (
    <div className="loginwrap">
      <div className="login">
        <img src="https://i.pinimg.com/736x/82/ee/a2/82eea2c87dc9a870eb5a354eae996b9f.jpg"></img>
      </div>
      <button className="gmail-login" onClick={loginHandler}>
        Login With Gmail
      </button>
    </div>
  );
};
export default Login;
